import React from 'react';
import './contact.styles.scss';

const ContactPage = () => (
    <div className='contact-page'>
        <div className='about-area'>
            <h2 className='title'>About</h2>
            <p className='content'>
                Crown Clothing is one of the best known fashion companies.<br />

                We have an unique business model. Through innovation, we're creating a seamless experience to serve our customer with design, production, distribution and sales online.
            </p>
        </div>

    </div>
);

export default ContactPage;
